MongoDB: return a single field from the matched item of a sub-document array<p>Consider I have the following document structure:</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;_id&quot;: ObjectID(),
  &quot;foo&quot;: &quot;FOO&quot;,
  &quot;bar&quot;: &quot;BAR&quot;,
  &quot;items&quot;: [
    {
      &quot;foo&quot;: &quot;FOO&quot;,
      &quot;bar&quot;: &quot;BAR&quot;,
      &quot;name&quot;: &quot;hello&quot;,
      &quot;value&quot;: &quot;50&quot;
    },
    {
      &quot;foo&quot;: &quot;FOO&quot;,
      &quot;bar&quot;: &quot;BAR&quot;,
      &quot;name&quot;: &quot;bye&quot;,
      &quot;value&quot;: &quot;300&quot;
    },
    {
      &quot;foo&quot;: &quot;FOO&quot;,
      &quot;bar&quot;: &quot;BAR&quot;,
      &quot;name&quot;: &quot;welcome&quot;,
      &quot;value&quot;: &quot;500&quot;
    }
  ],
}
</code></pre>
<p>I would like to find all items that match both the following conditions:</p>
<ul>
<li><code>name = &quot;hello&quot;</code></li>
<li><code>value != 0</code></li>
</ul>
<p>And for each matched item I would like to return only the <code>value</code> field. I don't need all the other fields (<code>foo</code>/<code>bar</code> in this example).</p>
<p>So the ideal result should look like this:</p>
<pre class="lang-json prettyprint-override"><code>[
  { value: &quot;50&quot; },
  { value: &quot;100&quot; },
  { value: &quot;30&quot; },

]
</code></pre>
<p>How do I do this with MongoDB?</p>
<p>I've tried this query:</p>
<pre class="lang-js prettyprint-override"><code>// filter
{
  items: {
    $elemMatch: {
      name: &quot;hello&quot;,
      value: { $ne: &quot;0&quot; },
    },
  }
}

// projection
{ 
  &quot;_id&quot;: 0,
  &quot;items.$&quot;: 1
}
</code></pre>
<p>It matches the items correctly, but it returns the whole items and I want only a single field from it.</p>
<p>Sadly, I can't use projection like this: <code>&quot;items.$.value&quot;: 1</code>.</p>
<p>I've also tried the following aggregation:</p>
<pre class="lang-js prettyprint-override"><code>{
  $unwind: {
    path: &quot;$items&quot;
  }
}
{
  $match: {
    &quot;items.name&quot;: &quot;hello&quot;,
    &quot;items.value&quot;: { $ne: &quot;0&quot; },
  }
}
{
  $replaceRoot: {
    newRoot: &quot;$items&quot;
  }
}
{
  $project: {
    &quot;value&quot;: 1
  }
}
</code></pre>
<p>It works perfectly and returns the expected result, but I have a feeling that it will have poorer performance.</p>
<p>Is there a way to achieve what I want with optimal performance?</p>

