});
</code></pre>
<p>But, I want to sort the result by the number of condition the object returned have. Like :</p>
<p>If I have 2 conditions, I want to display first the objects respecting the <strong>2 conditions</strong>, then the objects respecting the <strong>1st condition</strong>, and finally the objects respecting the <strong>2nd condition</strong>.</p>
<p>Do you guys know how I can do this? :)</p>
<p>Thanks in advance !</p>
<p><strong>================EDIT================</strong></p>
<p>This is the new search function :</p>
<pre><code>  /**
   * Search function which returns users matching jobs and skills.
   *
   * @param {Array[String]} jobs
   * @param {Array[String]} skills
   * @return {Array[UserModel]} users
   */
  async search(jobs, skills) {
    // Normalized arrays of jobs, skills and fields (to use it in a mongoose request).
    const jobSkills = [];
    const associatedSkills = [];
    const fields = [];

    for (const job of jobs) {
      jobSkills.push({
        $cond: [
          {
            $eq: [&quot;$jobSkills&quot;, job],
          },
          2,
          0,
        ],
      });
      fields.push({
        jobSkills: job,
      });
    }

    for (const skill of skills) {
      associatedSkills.push({
        $cond: [
          {
            $eq: [&quot;$associatedSkills&quot;, skill],
          },
          1,
          0,
        ],
      });
      fields.push({
        associatedSkills: skill,
      });
    }

    // Request to find users matching jobs and skills.
    const users = await UserModel.aggregate([
      {
        $match: {
          $or: fields,
        },
      },
      {
        $addFields: {
          sortField: {
            $sum: jobSkills.concat(associatedSkills),
          },
        },
      },
      {
        $sort: {
          sortField: -1,
        },
      },
    ]);

    return users;
  }
